import React from "react";

export default function About() {
  return (
    <div>
      <h1>About this app</h1>
      <p className="my-1">
        This is a full stack React app for keeping contacts
      </p>
      <p className="bg-info p-1">
        <strong>Version:</strong> 1.0.0
      </p>
    </div>
  );
}
